class Hello {

	def log;
	def context;
	def testRunner;

	def Hello(log, context, testRunner) {
		this.log = log;
		this.context = context;
		this.testRunner = testRunner;
	}

	def sayHello(String name) {
		log.info ("Saying hello:"+name);
	}
}

context.setProperty("Hello", new Hello(log,context,testRunner));

//Call Classe from another testStep
project = testRunner.testCase.testSuite.project;
tcase = project.testSuites["TestSuite3"].testCases["TestCase1"];
hello = tcase.getTestStepByName("Hello");

hello.run(testRunner, context);

context.Hello.sayHello("Stef");

//Run a step by Groovy
def status = testRunner.runTestStepByName("CountryISOCode");

def result = status.getStatus().toString();

//Si pas d'assertion : status = UNKNOWN
log.info ("Status = "+result);

if(result == "OK"){
	log.info ("OK");
} else {
	log.info ("KO");
}

//Run a test step in another testCase
project = testRunner.testCase.testSuite.project;
tcase = project.testSuites["TestSuite3"].testCases["TestCase3"];
tstep = tcase.getTestStepByName("CountryISOCode");

def status = tstep.run(testRunner, context);

def result = status.getStatus().toString();

log.info (result);

//Run a test Case
def tCase2 = testRunner.testCase.testSuite.testCases["TestCase3"];
def prop = new com.eviware.soapui.support.types.StringToObjectMap();
//True or false : assynchronous run or not
runner = tCase2.run(prop, false);
//Ou bien 
runner2 = tCase2.run(null, false);

def result2 = runner.getStatus().toString();
log.info (result2);

def result3 = runner2.getStatus().toString();
log.info (result3);

//How to get list of all TestCases in a test suite and run the Tests Cases without TestCase4
def testCases = context.testCase.testSuite.getTestCaseList();
testCases.each {
	//Run the testCase 1,2,3
	if (it.name != "TestCase4") {
		log.info ("name "+it.name);
		def tCase2 = testRunner.testCase.testSuite.testCases[it.name];
		def prop = new com.eviware.soapui.support.types.StringToObjectMap();
		//True or false : assynchronous run or not
		runner = tCase2.run(prop, false);
		def result = runner.getStatus().toString();
		log.info (result);
	}
}

//Get the name of current test case
log.info ("test case name = "+testRunner.testCase.name)

def tcase = testRunner.testCase.testSuite.testCases["TestCase6"];
def prop = new com.eviware.soapui.support.types.StringToObjectMap();
runner = tcase.run(prop, false);
def result = runner.getStatus().toString();
log.info (result);

def suite = context.testCase.testSuite.project.testSuites["TestSuite2"];
suite.run(null,false);

log.info (" >>> "+suite.getName()+" - Executed successfully");

//Run a Project test
def projectName = testRunner.getTestCase().getTestSuite().getProject().getWorkspace().getProjectByName("RESTProject2");

def runStatus = projectName.run(null,true);
Thread.sleep(6000);
 log.info ("status = "+runStatus.getStatus().toString());

